class Solution(object):
    def constructProductMatrix(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: List[List[int]]
        """
        n, m = len(grid), len(grid[0])
        product = 1
        zero_count = 0
        for i in range(n):
            for j in range(m):
                if grid[i][j] != 0:
                    product = (product * grid[i][j]) % 12345
                else:
                    zero_count += 1

        result = [[0 for _ in range(m)] for __ in range(n)]
        if zero_count > 1:
            return result

        for i in range(n):
            for j in range(m):
                if zero_count == 0:
                    result[i][j] = (product * pow(grid[i][j], 12343, 12345)) % 12345
                elif grid[i][j] == 0:
                    partial_product = 1
                    for k in range(n):
                        for l in range(m):
                            if k != i or l != j:
                                partial_product = (partial_product * grid[k][l]) % 12345
                    result[i][j] = partial_product
        return result
